import React from "react";
import QuestionCard from "./QuestionCard";

const GameContinaer = (e) => {

    const cartoonNetwork = [
        { network: 'CartoonNetwork', show: 'PowerPuffGirls' },
        { network: 'CartoonNetwork', show: 'KND' },
        { network: 'CartoonNetwork', show: 'FostersHome' }
    ];

    const disney = [
        { network: 'Disney', show: 'DannyPhantom' },
        { network: 'Disney', show: 'LiloAndStitch' },
        { network: 'Disney', show: 'PhineasAndFerb' }
    ];

    const nickelodeon = [
        { network: 'Nickelodeon', show: 'FairyOddParents' },
        { network: 'Nickelodeon', show: 'JimmyNeutron' },
        { network: 'Nickelodeon', show: 'SpongeBobSquarepants' }
    ];

    const showQuestions = [
        { show: 'PowerPuffGirls',
            questions: {
                1: 'What was the recipe for chemical X?',
                2: 'What was the name of the Monkey villain?',
                3: 'What fictional town did the Powerpuff girls live in and protect?'
            } }
    ];


    return (
        <div>

        {/* Networks: CartoonNetwork  Disney  Nickelodeon */}

        {/* Shows in CartoonNetwork: PowerPuffGirls    KND   FostersHome  */}
        {/* Shows in Disney: DannyPhantom    LiloAndStitch     PhineasAndFerb  */}
        {/* Shows in Nickelodeon: FairyOddParents    JimmyNeutron   SpongebobSquarepants  */}

        <QuestionCard Network={'CartoonNetwork'} Show={'PowerPuffGirls'} Question={showQuestions.show(Show).questions(1)}/>
        <QuestionCard Network={'Disney'} Show={'DannyPhantom'} />
        <QuestionCard Network={'Nickelodeon'} Show={'FairyOddParents'} />
        <QuestionCard Network={'Disney'} Show={'LiloAndStitch'} />
        <QuestionCard Network={'CartoonNetwork'} Show={'KND'} />
        <QuestionCard Network={'Disney'} Show={'PhineasAndFerb'} />
        <QuestionCard Network={'Nickelodeon'} Show={'JimmyNeutron'} />
        <QuestionCard Network={'Nickelodeon'} Show={'SpongebobSquarepants'} />
        <QuestionCard Network={'CartoonNetwork'} Show={'FostersHome'} />
      </div>
    );
}

export default GameContinaer;
